(1, 2, 51, 'Ignat otnovo se izloji :/', '2017-12-03 00:00:00', 'Does life exist on Mars...', '/files/users/cyecize/297ef53cd802e927fcc64b8c0036d60a.jpeg', '<p><strong><em>И понеже само пет не ни стигат, представям ви:</em></strong></p><h3>Анализи на чалга песни (и подобни)… 2</h3><p class=\"ql-align-center\"><strong><u>Гери Никол</u></strong></p><p class=\"ql-align-center\">Откачена съм била</p><p class=\"ql-align-center\">К’во ми се надуваш, да не съм ти жена?</p><p class=\"ql-align-center\">Ще ти покажа кой е шефа на мига.</p><p class=\"ql-align-center\">Аз&nbsp;– много ясно . Запомни ме така.</p><p class=\"ql-align-center\">Яката дупара, яката дупара.</p><p class=\"ql-align-center\">Сега ша ва запаля, сега ша ва запаля.</p><p>Опитвайки се да избяга от сивото ежедневие на следващия тълпата обикновен човек, авторката изпитва чувство на страх и параноя от това да бъде различна. Въпреки хорските предположения, че е откачена, тя смело им отвръща с „К’во ми се надуваш, да не съм ти жена?“, с което изразява несъгласието си спрямо половите норми, наложени от обществото. Според нея&nbsp;различните хора заслужават да бъдат запомнени „така“, а именно – като „шефове на мига“, т.е.&nbsp;не на миналото или бъдещето, а само и единствено на настоящето. По нейно мнение една достойна жена трябва да има прелестен голям седалищен мускул, за да може да подпалва хората само с неговото присъствие.</p><p class=\"ql-align-center\"><strong><u>Теди Александрова</u></strong></p><p class=\"ql-align-center\">Когато аз избухвам ще мълчите, да, да, да, да, да.</p><p class=\"ql-align-center\">Когато леко тъй си хващам ритъма, да, да, да, да.</p><p class=\"ql-align-center\">Айде, чалга пеперудки във а-а, да, да, да, да.</p><p class=\"ql-align-center\">Стана време да ги мачкам в Пайнера, да, да, да, да.</p><p class=\"ql-align-center\">О, бейби,&nbsp;казваше ти – тук да слушаш и да изпълняваш.</p><p class=\"ql-align-center\">Мъката ми лека стои – ако не ти харесва, щти бия шута, ма.</p><p class=\"ql-align-center\">И за теб съм чисто нова сега – това са моите правила.</p><p class=\"ql-align-center\">Хейтърите ми са зад гърба, брат ми, като вятъра.</p><p><strong><em>Бележка от автора: Първата ми мисъл, когато прочетох този текст беше „Защо да не си намеря друго занимание…“.</em></strong></p><p>Авторката на този хит умело използва похвата на мозъчната ретардация. Като същинска атомна бомба („Когато аз избухвам,&nbsp;ще мълчите, да“), тя се свързва със своите слушатели, обещавайки да „мачка в Пайнера“. Когато леко тъй си хваща ритъма , тя оприличава себе си на какавида, готова да се превърне във феноменална чалга пеперудка. Силното желание да накара някой от своите последователи да слуша и да изпълнява,&nbsp;кара авторката да се чувства непобедима пред „хейтърите” си.</p><p>&nbsp;</p><p class=\"ql-align-center\"><strong><u>&nbsp;Анелия и Галин</u></strong></p><p class=\"ql-align-center\">Аз съм дяволът – да си внимавала!</p><p class=\"ql-align-center\">Чакаш ли някоя? Да знаеш – няма я.</p><p class=\"ql-align-center\">Убих я с погледа за нахални.</p><p class=\"ql-align-center\">Достъп всякакъв съм и отрязала,</p><p class=\"ql-align-center\">на разстояние да остане.</p><p class=\"ql-align-center\">Чакаш ли кротката? Пристигна водката,</p><p class=\"ql-align-center\">по мене тръгнал е като огън.</p><p class=\"ql-align-center\">Аз съм в ролята на най-жестоката,</p><p class=\"ql-align-center\">кажи на твоята да си тръгва.</p><p>&nbsp;</p><p>В жестокия свят, в който живеем, често срещаме хора, готови да отнемат човешката свобода и право на глас. Анелия и Галин много добре изразяват това – потресени от нещастията, случващите се на наоколо, те решават на напишат песен за жена, която има невероятната дарба да убива само с погледа си. Въпросната жена обаче не решава да използва дарбата си за добро, даже напротив – сравнена&nbsp;с дявол, тя предупреждава околните да внимават, защото винаги е готова да причини злини. След като отвлича съпругата на нещастен и самотен мъж, тя „отрязва достъпа й“ и я държи на разстояние само със своя „поглед за нахални“.&nbsp;Карайки всички жени наоколо да се чувстват застрашени, жената помръдва пръста си само, когато трябва да убива със своя поглед, като през останалата част от деня прекарва времето си като пие водка.</p><p class=\"ql-align-center\"><strong><u>Галин</u></strong></p><p class=\"ql-align-center\">Намери златна лампа и потърка,</p><p class=\"ql-align-center\">а духът отвътре се побърка.</p><p class=\"ql-align-center\">От 100 години тебе той те чака</p><p class=\"ql-align-center\">и готов е за атака.</p><p class=\"ql-align-center\">Аз съм на Египет фараона!</p><p class=\"ql-align-center\">Ставам на отбора шампиона!</p><p class=\"ql-align-center\">Луд съм, и това не е легенда,</p><p class=\"ql-align-center\">мога всичко на момента!</p><p>Човекът винаги е бил заинтересован от митовете и легендите. Още от древни времена, хората вярвали в богове, кръвожадни чудовища и духове в лампи. За да ни припомни тези славни, изпълнени с приключения времена, Галин написва „На Египет фараона“, който разказва невероятната история за жадният за отмъщение дух от златна лампа, който 100 години чака денят на своето възмездие.Освен за изпълняващ желания джин, в интригуващото</p><p><img src=\"https://1.gravatar.com/avatar/ae432486ede7309de7f6c5fed5a19c86?s=100&amp;d=identicon&amp;r=G\" height=\"100\" width=\"175\"></p><p>произведение се разказва за египетски фараон, шампион на митичен отбор (и тук е възможно авторът да има предвид олимпийските игри, но поради неточности в преписванията, смисълът да се губи). Според самия автор любовта към мистериозното, свръхестественото ни кара да се чувстваме така, сякаш нищо не е невъзможно и можем да направим всичко на момента.</p><p><strong><em>И така нататък….</em></strong></p><p><strong><em>Тук да добавя аз (цеци)...</em></strong></p><p>Like, Share, Subscribe... Although you can\'t because its not implemented yet ==D</p><p><br></p><iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"//widgets.wp.com/likes/index.html?ver=20180319#blog_id=121559043&amp;post_id=155&amp;origin=tonipetrova.wordpress.com&amp;obj_id=121559043-155-5b467b6ef1454\"></iframe><p><br></p>', 1, 45, 18, 0),
(3, 2, 51, 'Deer Dance', '2018-07-10 00:00:00', 'This is an example summary', 'https://tonipetrova.files.wordpress.com/2017/04/beautiful-nature-015.jpg?w=816', '<p>Ставаш сутрин, гледаш – мрак и облаци, обръщаш внимание на незначителни подробности. Всеки те дразни, всеки е ръб. Нищо не тръгва добре, животът е тъп. И единственото, което би оправило нещата е да забиеш юмрук в на някого главата. Но не се притеснявай. Върви по своя път. Днес просто такъв е денят. Стъпваш в кална локва, панталонът ти е мокър, сякаш някой е направил зла магия и нарочно иска да ти прави гадории. Хората те обиждат, навярно защото също не им върви. Бил си скучен, мързелив…Я по-добре си тръгни. Иска ти се да им докажеш, че преди теб ще умрат, защото днес просто такъв е денят.</p><p>Ходиш на работа, училище, мислиш за пари, тревоги, същинско житейско мъчилище!</p><p>Бяла птица с разперени крила? Друг път. Крилата може да си завре в дупка. Свобода не очаквай. Няма я. Но не се и оплаквай. Ще продължават хората да те подритват, безинтересно им е ти какви чувства изпитваш. Би било най-добре да се срути небето гръмогласно. На всички ще е ясно кого ще затрупа – онези, на които, нали, много им пука. Ще ти кажа какво. <span style=\"background-color: rgb(0, 0, 0); color: rgb(255, 255, 0);\">Тегли една черта и върви по своя път, защото днес просто такъв е денят</span>.</p>', 1, 650, 4, 0),
